__NUXT_JSONP__("/retezec/dunkin-donuts", (function(a){return {data:[{chain:[{created_at:"2023-12-23T12:31:51.26857+00:00",date_update:a,id_image_cover:a,id_image_hero:a,name:"Dunkin' Donuts",description:"\u003Cp\u003EDunkin' Donuts je celosvětová kavárna a fast food řetězec, specializující se na kávu a sladké pečivo, zejména na koblihy. Byla založena v roce 1950 v Quincy, Massachusetts, Spojené státy. Od té doby se rozrostla na tisíce poboček po celém světě a stala se jedním z nejznámějších a nejoblíbenějších řetězců kaváren.\u003C\u002Fp\u003E\n\n\u003Cp\u003EJedním z hlavních prvků úspěchu Dunkin' Donuts je jejich rozmanitý sortiment nápojů, včetně různých druhů kávy, čajů a ledových nápojů. Kromě toho jsou známí svými čerstvými a lahodnými koblihami, které nabízejí v různých příchutích a kombinacích.\u003C\u002Fp\u003E\n\n\u003Cp\u003EŘetězec Dunkin' Donuts se snaží přinést zákazníkům nejen chutné pečivo a nápoje, ale také pohodlný zážitek. Mnoho jejich poboček je otevřeno 24 hodin denně, což umožňuje zákazníkům těšit se z jejich produktů kdykoliv potřebují. Kromě toho nabízí také různé snídaně a občerstvení, což činí Dunkin' Donuts oblíbeným místem pro rychlý občerstvující zastávku.\u003C\u002Fp\u003E",information:[],slug:"dunkin-donuts",seo_tags:[],ids_states:[],id:12,updated_at:"2024-01-12T09:58:56.814979+00:00"}],placesStates:a,imageChain:a,imagesStates:a}],fetch:{},mutations:[]}}(null)));